(133, '_transient_dash_f69de0bbfe7eaa113146875f40c02000', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2016/10/join-us-again-for-global-wordpress-translation-day/''>Join Us Again for Global WordPress Translation Day</a> <span class="rss-date">14.10.2016</span><div class="rssSummary">The WordPress Polyglots team is organizing the second Global WordPress Translation Day on November 12th. Everyone is invited to join – from anywhere in the world! Translating is one of the easiest ways to get involved with WordPress and contribute to the project. Global WordPress Translation Day is your chance to learn more about translating WordPress, meet [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://ma.tt/2016/10/taking-sides/''>Matt: Taking Sides</a></li><li><a class=''rsswidget'' href=''https://ma.tt/2016/10/defrauding-an-election/''>Matt: Defrauding an Election</a></li><li><a class=''rsswidget'' href=''https://wptavern.com/peter-meth-launches-kickstarter-campaign-to-produce-7-wapuu-plush-toys''>WPTavern: Peter Meth Launches Kickstarter Campaign to Produce 7″ Wapuu Plush Toys</a></li></ul></div><div class="rss-widget"><ul><li class="dashboard-news-plugin"><span>Популярный плагин:</span> Google Analytics Dashboard for WP&nbsp;<a href="plugin-install.php?tab=plugin-information&amp;plugin=google-analytics-dashboard-for-wp&amp;_wpnonce=16fd334887&amp;TB_iframe=true&amp;width=600&amp;height=800" class="thickbox open-plugin-details-modal" aria-label="Установить Google Analytics Dashboard for WP">(Установить)</a></li></ul></div>', 'no'),
