(1, 1, '2016-10-24 10:23:22', '2016-10-24 07:23:22', 'Добро пожаловать в WordPress. Это ваша первая запись. Отредактируйте или удалите её, затем пишите!', 'Привет, мир!', '', 'publish', 'open', 'open', '', '%d0%bf%d1%80%d0%b8%d0%b2%d0%b5%d1%82-%d0%bc%d0%b8%d1%80', '', '', '2016-10-24 10:23:22', '2016-10-24 07:23:22', '', 0, 'http://potolky2/?p=1', 0, 'post', '', 1),
(2, 1, '2016-10-24 10:23:22', '2016-10-24 07:23:22', '', 'Услуги', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2016-10-24 14:36:30', '2016-10-24 11:36:30', '', 0, 'http://potolky2/?page_id=2', 0, 'page', '', 0),
(3, 1, '2016-10-24 10:23:40', '0000-00-00 00:00:00', '', 'Черновик', '', 'auto-draft', 'open', 'open', '', '', '', '', '2016-10-24 10:23:40', '0000-00-00 00:00:00', '', 0, 'http://potolky2/?p=3', 0, 'post', '', 0),
(4, 1, '2016-10-24 13:27:43', '2016-10-24 10:27:43', 'Это пример страницы. От записей в блоге она отличается тем, что остаётся на одном месте и отображается в меню сайта (в большинстве тем). На странице «Детали» владельцы сайтов обычно рассказывают о себе потенциальным посетителям. Например, так:\r\n<blockquote>Привет! Днём я курьер, а вечером — подающий надежды актёр. Это мой блог. Я живу в Ростове-на-Дону, люблю своего пса Джека и пинаколаду. (И ещё попадать под дождь.)</blockquote>\r\n...или так:\r\n<blockquote>Компания «Штучки XYZ» была основана в 1971 году и с тех пор производит качественные штучки. Компания находится в Готэм-сити, имеет штат из более чем 2000 сотрудников и приносит много пользы жителям Готэма.</blockquote>\r\nПерейдите <a href="http://potolky2/wp-admin/">в консоль</a>, чтобы удалить эту страницу и создать новые. Успехов!', 'Пример страницы', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2016-10-24 13:27:43', '2016-10-24 10:27:43', '', 2, 'http://potolky2/2016/10/24/2-revision-v1/', 0, 'revision', '', 0),
